SC=最新版本: V4.0.1\n\n\n更新日志:\n\n0.增加"从DNS解析IP功能"\n\n1.内部hosts编辑增加F3搜索\n\n2.语言选择与读取数据同时进行(默认按系统语言选择)\n\n3.操作提示文本完善\n\n4.禁用R2R编译解决闪退/UI空白等兼容性问题\n\n5.其他改进\n\n
